      out.write("   <a name=\"top\"></a>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">Famous Temples In and Around Udaipur</p><br/>\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Most of us are unaware that Udaipur is also famous for its temples. \r\n");
      out.write("   These temples are visited by several thousand tourists every year. Many tourists visit these temples regularly. \r\n");
      out.write("   The vibrant and marvelous historical background of Mewar region reveals that many of these temples were built by the emperors of Mewar dynasty. \r\n");
      out.write("   Throughout the history; the emperors of Mewar had showcased a blend of courage and spirituality. \r\n");
      out.write("   These are few famous temples of Udaipur and their small stories behind their construction.</p><br/>\r\n");
      out.write("  </td>\r\n");
