      out.write(" <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">1. Bohra Ganesh Temple</p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/bohraganeshji.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Bohra Ganesh Ji a very old and famous temple of Udaipur is situated near Mohanlal Sukhadia University. \r\n");
      out.write("    A standing statue of Shri Ganesh Ji has been established which bestow blessings to hundreds of devotees visiting every day.\r\n");
      out.write("    In India it is a custom to worship Lord Ganesh whenever something new is started like new business, new asset or starting a new relationship. \r\n");
      out.write("    Wednesday is considered as the special day to worship Lord Ganesha. Thousands of devotees visit Bohra Ganesh Ji temple to offer Prayer and Prasad (Sweets) to Shri Ganesh Ji. \r\n");
      out.write("    Without his worship no holy work is considered to be complete.</p><br/>\r\n");
      out.write("  </td>\r\n");
      out.write(" </tr>\r\n");
      out.write(" <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">2. Karni Mata Temple</p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Karni-Mata-Medium.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Karni Mata Temple is situated at Machhla Hills and surrounded by the bliss of the nature. \r\n");
      out.write("   Being situated at height, people can enjoy the panoramic view of Lake Pichhola, Dudh Talai and Sajjangarh. \r\n");
      out.write("   The sunset could be enjoyed in the evening from the sunset point built beside the temple. The temple could be reached through the rope way that starts from Dudh Talai or through stairs that starts from Deendayal Upadhyay Park. \r\n");
      out.write("   Maharana Karan Singh made residence at Machhla Magra between 1620 and 1628. During this time the temple was built. \r\n");
      out.write("   For a long time it remained as a deserted place and in 1997 Manshapurna Karni Mata Development Committee renovated it.</p><br/>\r\n");
      out.write("  </td>\r\n");
      out.write(" </tr>\r\n");
      out.write(" <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">3. Ekling Ji Temple</p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/eklingji-temple-640x474.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Ekling Ji temple is situated 22 kilometers far from Udaipur. \r\n");
      out.write("   It is said that the forefathers of Bappa Rawal ruled the Mewar dynasty. They had enmity with the Mauryas.\r\n");
      out.write("   The Mauryas wanted to kill their family. His mother escaped and came to a place known as Kailashpuri.\r\n");
      out.write("    Bappa started grazing herd of cows. One day he noticed that a cow entered into the dense bushes and at a lonely place and started shredding milk. \r\n");
      out.write("   The place was later recognized as shivalingam and after that Ekling ji temple was built by Bappa Rawal.</p><br/>\r\n");
      out.write("  </td>\r\n");
      out.write(" </tr>\r\n");
      out.write(" <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">4. Jagdish Temple </p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Jagdish-Mandir-Medium.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Jagdish Temple was built by Maharana Jagat Singh of Udaipur. \r\n");
      out.write("   Maharana Jagat Singh had deep devotion in Lord Jaganath Puri of Orissa. He used to visit Jagan Nath temple in every annual rath yatra.\r\n");
      out.write("    At one occasion he could not reached at the rath yatra on time and he had to halt in the midst of his journey.\r\n");
      out.write("    Maharana got disappointed a lot that he could not attend the rath yatra.\r\n");
      out.write("    When re reached there he had a dream in which the Lord told him that there is no need to travel such long distance and he could made a temple in his city itself.\r\n");
      out.write("    After returning Udaipur he started the construction of the temple.</p><br/>\r\n");
      out.write("   </td>\r\n");
      out.write("  </tr>\r\n");
      out.write("  <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">5. Neemach Mata </p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Neemach-Mata-Medium.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Neemach Mata is a famous temple in Udaipur and it is situated at a small hill top near Fateh Sagar Lake. According to the residents here this temple is also considered as Vaishno Devi of Udaipur.\r\n");
      out.write("    The name Neemach Mata came due to its origin, which is under a Neem tree. People here believe that those who come here regularly and offer their worship never get any skin ailments due to the strong spiritual spirit of the neem tree. \r\n");
      out.write("   Several pilgrims and tourists visit the Neemach Mata temple every year.</p><br/>\r\n");
      out.write("  </td>\r\n");
      out.write(" </tr>\r\n");
      out.write(" <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">6. Shrinath Ji Temple </p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Shriji.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Shrinath Ji temple is situated at Nathdwara, which is around 50 kilometers from Udaipur city and it is also termed as the gateway to lord Shrinath Ji.\r\n");
      out.write("    The temple was built in 17th century and owes a great story behind it. It is said that an idol of Lord Krishna was transferred to a distant and safer place from Vrindavan. There were chances of its destruction of the idol by the Mughal Emperor Aurangzeb. When the idol reached this placed the bull cart stuck in deep mud and could not moved further.\r\n");
      out.write("    The priest accompanying the idol thought it as the right place and therefore Shrinath Ji temple was built in Nathdwara.</p><br/>\r\n");
      out.write("   </td>\r\n");
      out.write("  </tr>\r\n");
      out.write("  <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">7. Ambamata Temple </p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Amba-Mata-Ji-Medium.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">The Ambamata Temple deserves the fame as it is one of the main temple of Udaipur. \r\n");
      out.write("    The temple too has a fascinating story behind its construction. It is been said that the erstwhile Maharana of Udaipur Maharana Raj Singh had severe eye problem that did not recovered after treatment.\r\n");
      out.write("    Someone suggested Maharana Raj Singh to have darshan of Amba Mata in Gujarat.\r\n");
      out.write("    At the night before the departure for his journey he had a dream of Goddesses that told him to construct the temple in Udaipur.\r\n");
      out.write("    Next day Maharana visited the place where he found the statue of Ambamata and started the construction of the temple and his ailment also recovered very soon.\r\n");
      out.write("    The spirituality of the temple is so strong that from the poorest to richest person in the world including celebrities & stars visit Shrinath Ji temple for darshans and manoraths.</p><br/>\r\n");
      out.write("   </td>\r\n");
      out.write("  </tr>\r\n");
      out.write("  <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">8. Sagasji Bavji Temple</p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Sagas-Ji-Bavji-Medium.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">Sagasji Bavji temple is situated at Sarvaritu Vilas. \r\n");
      out.write("    Sagasji Bavji is worshiped as a symbol of bravery as people say that he never lost a war in his life. Sagasji was son of Maharaj Raj Singh. \r\n");
      out.write("    When Sagasji lost his life his wife Maharani Kunwariprada became a sati. Every year Sagasji's birthday is celebrated with full glory and fervor.\r\n");
      out.write("    Thousands of devotees wait in long queues to have a glimpse of Sagasji Maharaj. There is a large idol of Ganesh Ji that catches eye of devotees visiting the temple.\r\n");
      out.write("    On his birthday the temple remains open for 24 hours for few days. \r\n");
      out.write("    The occasion is celebrated with night jagrans and the crowd enjoys with full enthusiasm and vigor.</p><br/>\r\n");
      out.write("   </td>\r\n");
      out.write("  </tr>\r\n");
      out.write("  <tr>\r\n");
      out.write("  <td>\r\n");
      out.write("   <p style=\"font-family: cursive;font-size: x-large;font-weight: bold;color: Orange\">9. Mahalaxmi Temple </p><br/>\r\n");
      out.write("   <img src=\"/vision/user/images/temples/Mahalakshmi-Temple-Medium.jpg\" />\r\n");
      out.write("   <p style=\"color: White;font-family: cursive;font-size: medium;text-align: justify;\">The Mahalaxmi Temple is situated at Bhattiyani Chohatta and it was named after Bhati Rani who developed this area. \r\n");
      out.write("    It is said that the temple was built by Maharana Shambhu Singh who fought a battle and brought idols of Mahalaxmi, Rishabhdev and Sundar Vinayak. Mahalaxmi is considered Goddess of wealth and prosperity and worshipped by everyone.\r\n");
      out.write("    The birthday of Mahalaxmi is celebrated every year with fervor and passion. Devotees visits temple and wait in long queues to offer their prayers and Prasad. On the day of Deepawali the temple opens at 5.30 am with the Mangla Aarti. \r\n");
      out.write("    His highness Shri Arvind Singh Mewar visits the temple every Diwali to offer prayers on the occasion of the holy festival of lights.</p><br/>\r\n");
